A function 'findPair(low, high, sum)' can be used to generate all pairs of numbers within a given range with a given sum. The function takes in three parameters, low and high which define the range, and sum which defines the given sum. The function can be implemented as follows: 

def findPair(low, high, sum): 
  outputList = []
  for i in range(low, high + 1): 
    for j in range(low, high + 1): 
      if (i + j == sum):
        outputList.append([i,j])
  return outputList

